#IPSY #IPSYpartner #ad Hello instagram! I am here to share my simple date night look using items I received in my @ipsy December glam bag. 
@nailmedic Nail Polish “Mauvy or Nice” is a 5 free polish that protects against toxins & pollutants plus restores your nails
@hanhoousa Watermelon Illuminator Daytime Facial Oil provides all-day hydration for a bright, glowing complexion.
@Heyhoney Look Into My Eyes Retinol Eye Mask combines the healing power of Propolis with Retinol to boost radiance and smooth.
@belifusa The True Cream- Moisturizing Bomb provides skin with intense hydration, leaving skin smooth, and deeply nourished
@benefitcosmetics The POREfessional: Pearl Primer minimizes the look of pores while still leaving some radiance to my face
@luxiebeauty 237 Blending Dreamcatcher is cruelty free premium synthetic brush that is the perfect size for blending the crease shade
@phasezeromakeup Shimmer Eyeshadow
“Nude Newbie” is velvety soft, long wearing and a beautiful pigment
@suvabeauty Eyeshadow “Empire State” blends perfectly with the previous shade to create a light champagne lid color. 
@tartecosmetics Amazonian Clary 12-Hour Blush “Shimma & Shake” long wearing blush that is a beautiful everyday shade
@tartecosmetics Amazonian Clay Waterproof Bronzer “Park Ave Princess” gives some warmth to my face like I got a sun kissed glow baby
@colouredraine Glowlighter “Selfie” adds a beautiful glow to my face and highly pigmented 
@tpsycolors Lip Crush Lip Oil lightweight lip oil that deeply moisturizes my dry lips 
@naturelabtokyo Perfect Smooth Hair Oil clean haircare that adds shine and hydration to my hair plus helps keep my extensions healthy too!

