I dont know what to call this look, but it’s easy and I LOVE IT <3 
One eyeshadow, you can’t mess that up. Using items I received in my @IPSY September Glam Bag 
@skyniceland Icelandic Youth Serum - Powered by Astaxanthin, one of the most powerful antioxidants on the planet, to hydrate, brighten and smooth stressed skin
@COOLA Mineral SPF30 Sun Silk Crème - Provides broad spectrum UVA/UVB protection
@smashboxcosmetics Studio Skin 15 Hour Wear Hydrating Foundation Shade 3.18 - Oil Free, Lasts 24 hours
