Just a quick little tut, im not sure what to call this look, just simple, pink eye? hahah. Using items from my @ipsy  August Glam Bag! I can’t believe its September now? What in the what?
@belifusa Moisturizing Eye Bomb floods fine lines with hydration for a smooth, supple appearance and crease-free makeup application.
@incrediblecosmetics Jelly Shot Lip Quencher "Ex Revenge” is formulated with a blend of avocado, vitamin E and rice bran oil to nourish, moisturize and repair lips. Im super dry right now so, gimmie all hydration!
 @ahava Dead Sea Water Mineral Body Lotion helps maintain healthy, hydrated skin that lasts all day. I normally put on lotion after doing my makeup or in the morning with my skin care, but I felt my dry hands cracking and needed to put this on asap.  @elizabethmott Thank Me Later Face Primer - Illuminating Primer has a hydrating formula that helps create a smooth, powerless canvas
 @vasanticosmetics Concealer Buffer - Undereye Setting Brush made with 100% synthetic fibers, vegan and cruelty-free. This can be a great eyeshadow blending brush as well but I love it for blending out my concealer and then using a loose setting powder to set my under eyes. 
@BuxomCosmetics Big Tease Plumping Mascara gives maximum volume, smudge and flake resistant. I love the brush on it!
@spacecasecosmetics Eyeshadow in “Intense Stargasm” is a beautiful silver-gray shimmer that is long-lasting with high-colour pay off.  @estatemakeup Dew Me Baked Highlighter “Lit” a really pretty champagne gold shade and gave some serious glow. I also popped it right in the corner of my eyes. 
@cucciocolour Nail Polish “GAIA” 10 free formula in a pretty berry creme color
