Here’s me being a profesh beauty IG-er and creating an easy summer time makeup look 👀 
Using my @ipsy July glam bag to create this look #ipsypartner 
Started with @muradskincare Essential-C Cleanser which is antioxidant-rich & restores moisture to the skin. 
@ciatelondon Watermelon Burst Hydrating Primer helps grip foundation for longwear and added glow.
@colouredraine eyeshadow in “Super Star”. Highly pigmented and creamy formula. 
@eyeko Beach Waterproof Mascara. The unique wand shape helps to lift and curl the lashes, plus stay all day. 
@billiondollarbrows Eyebrow Brush helps precisely define my eyebrows while spoolie  brush blends for a natural finish.
@southseasofficial “Mother Of Pearl Illuminator”. Lightweight, gives life to dull skin especially in the sun. 
@wetnwildbeauty Megaglo Highlighting Powder in “Crown Of My Canopy”. Infused with ultra reflective and micro fine pearl pigments for a beautiful glow.
